create table brand (id int identity not null, eng_name Nvarchar(max), image Nvarchar(max), name Nvarchar(max), primary key (id))
create table business_payment_method (fk_business_id int not null, fk_payment_method int not null, primary key (fk_business_id, fk_payment_method))
create table business_user (fk_brand_id int, id int identity not null, rate float(53), address Nvarchar(50), background_color Nvarchar(50), business_type Nvarchar(50), city Nvarchar(15), describe Nvarchar(100), dist Nvarchar(15), eng_name Nvarchar(50), image_ad Nvarchar(max), image_icon Nvarchar(max), image_index Nvarchar(max), join_date varchar(255), name Nvarchar(max), operation_time Nvarchar(50), password Nvarchar(max), phone Nvarchar(max), text_color Nvarchar(50), primary key (id))
create table category (id int identity not null, category_name Nvarchar(50), primary key (id))
create table coupon (amount int, discount int, id int identity not null, threshold int, create_date datetime2, end_date datetime2, start_date datetime2, description nvarchar(100), title nvarchar(30), primary key (id))
create table coupon_bind (fk_coupon_id int, fk_guest_id int, id int identity not null, used int, create_date datetime2, used_date datetime2, code varchar(255), primary key (id))
create table credit_card (default_card int, fk_guest_id int, id int identity not null, credit_card_no bigint, name Nvarchar(30), primary key (id))
create table customize (fk_category_id int, id int identity not null, cust_cate_name Nvarchar(max), primary key (id))
create table customize_option (extra_price int, fk_customize_id int, id int identity not null, cust_option_name Nvarchar(max), primary key (id))
create table guest_address (fk_guest_id int, id int identity not null, address Nvarchar(100), city Nvarchar(30), dist Nvarchar(30), primary key (id))
create table guest_user (gender bit, google_id int, id int identity not null, birthday Nvarchar(max), email Nvarchar(max), image Nvarchar(max), invoice Nvarchar(max), join_date Nvarchar(max), name Nvarchar(30), nickname Nvarchar(30), password Nvarchar(max), phone varchar(255), tax_number Nvarchar(max), primary key (id))
create table likes (fk_business_id int not null, fk_guest_id int not null, primary key (fk_business_id, fk_guest_id))
create table order_detail (amount int, category int, fk_order_id int, fk_product_id int, id int identity not null, price int, product_total int, describe Nvarchar(100), image Nvarchar(max), name Nvarchar(max), primary key (id))
create table order_form (coupon_id int, fk_business_id int, fk_guest_id int, id int identity not null, payment_status int, total int, time datetime2(6), address Nvarchar(100), payment_type Nvarchar(max), pickup Nvarchar(max), text Nvarchar(50), primary key (id))
create table payment_method (id int identity not null, method Nvarchar(max), primary key (id))
create table product (fk_business_id int, fk_category_id int, id int identity not null, price int, status int, description nvarchar(100), eng_name nvarchar(30), image Nvarchar(max), name nvarchar(30), primary key (id))
create table revenue (id int not null, revenue int, date datetime2(6), primary key (id))
create table sales (fk_category_id int, id int identity not null, end_date datetime2(6), start_date datetime2(6), discount Nvarchar(max), primary key (id))
